import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import { Routes, Route, NavLink, Link } from "react-router-dom";
import Login from "./pages/Login";
import Registro from "./pages/Registro";

function Navbar() { /* …igual que antes… */ }
function Home() { /* …igual que antes… */ }

export default function App() {
  return (
    <>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/registro" element={<Registro />} />
        {/* rutas dummy */}
        <Route path="/products" element={<div className="container py-5">Products</div>} />
        <Route path="/rooms" element={<div className="container py-5">Rooms</div>} />
        <Route path="/inspiration" element={<div className="container py-5">Inspiration</div>} />
        <Route path="/sale" element={<div className="container py-5">Sale</div>} />
      </Routes>
    </>
  );
}
